import React, { Component } from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import forward from "../src/icons/next.svg";
import backward from "../src/icons/pre.svg";
import { NavLink } from "react-router-dom";
import ic from "../src/images/s5.webp";
export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,

      slidesToShow: 3,
      // arrow: true,
      slidesToScroll: 1,

      autoplay: true,
      autoplaySpeed: 2000,
    };
    return (
      <section class="top-products">
        <div class="container-2">
          <h1 class="section-heading">Important Topics</h1>

          <Slider {...settings}>
            <div className="p-image flex align-items justify-center">
              <img src={ic} alt="" />
            </div>
            <div className="p-image flex align-items justify-center">
              <img src={ic} alt="" />
            </div>
            <div className="p-image flex align-items justify-center">
              <img src={ic} alt="" />
            </div>
            <div className="p-image flex align-items justify-center">
              <img src={ic} alt="" />
            </div>
            <div className="p-image flex align-items justify-center">
              <img src={ic} alt="" />
            </div>
          </Slider>
          <div className="flex justify-center">
            <NavLink to="">
              <button className="s-btn-bg">More..</button>
            </NavLink>
          </div>
        </div>
      </section>
    );
  }
}
